    setTimeout(() => {
        svgTreePath.querySelectorAll('.treepathdraw path').forEach(e => {
            let length = e.getTotalLength() + 1;
            gsap.set(e, {
                "stroke-dasharray": (length + 1) + 'px',
                "stroke-dashoffset": (length + 2) + 'px',
                opacity: 1,
            });
        })
        svgTreePath.querySelectorAll('.treedots circle').forEach(e => {
            gsap.set(e, {
                opacity: 0,
            });
        })
        svgTreePath.querySelectorAll('.treeicos > g').forEach(e => {
            gsap.set(e, {
                opacity: 0,
            });
        })

        let treeSvgTl = gsap.timeline({ defaults: { ease: "none" } });
        treeSvgTl.set(svgTreePath, { opacity: 1 })
            .to('.treemainpath path', {
                "stroke-dashoffset": 0, opacity: 1, duration: 1.5, ease: "power3.easeOut"
            })
            .to('.treesubpath path', {
                "stroke-dashoffset": 0, duration: 1.1, delay: 1, ease: "power3.easeIn"
            }, "<")
            .to('.paths path', {
                "stroke-dashoffset": 0, duration: 1, delay: 0.3, ease: "power3.easeIn"
            }, "<")
            .to('.treedots circle', {
                opacity: 1, duration: 1, delay: 0.6,
            }, "<")
            .to('.treeicos > g', {
                opacity: 1, duration: 0.5, stagger: 0.05, ease: "power3.easeOut"
            }, "<");
        treeSvgTl.pause()
        ScrollTrigger.create({
            trigger: svgTreePath,
            start: "top 70%",
            animation: treeSvgTl,
        });
    }, 300);
